import React from "react";

const Navbar = () => {
  return (
    <nav style={{ background: "#333", padding: "10px 20px", color: "white", display: "flex", alignItems: "center", justifyContent: "space-between" }}>
      {/* Logo dan Nama */}
      <div style={{ display: "flex", alignItems: "center", gap: "10px" }}>
        <img src="logo.png" alt="Logo PumaSgnd" style={{ height: "40px" }} />
        <span style={{ fontSize: "20px", fontWeight: "bold" }}>PumaSgnd</span>
      </div>

      {/* Menu Navigasi */}
      <ul style={{ display: "flex", listStyle: "none", gap: "20px", margin: 0, padding: 0 }}>
        <li><a href="#about" style={{ color: "white", textDecoration: "none" }}>Tentang</a></li>
        <li><a href="#projects" style={{ color: "white", textDecoration: "none" }}>Proyek</a></li>
        <li><a href="#contact" style={{ color: "white", textDecoration: "none" }}>Kontak</a></li>
      </ul>
    </nav>
  );
};

export default Navbar;
